{"1": ["Сам пирсинг  мне нравится, смотрится хорошо, дуга не длинная, хорошо закручивается. Но вряд ли это серебро, хотя и все пробы были, после 1,5 месяца появились темные пятна. ", "2020-08-12T09:35:56Z", "серебристый", "0", 3, 0, 3, "Пирсинг в пупок", "МАРКИЗ"], "2": ["6 февраля 2019 года получили данный пирсинг в пункте самовывоза (город Волгоград). Пришёл в сером пакетике, который при нас открыли в пункте выдачи заказов. Товар полностью соответствует описанию, есть бирка и проба на штанге, без брака, верхний шарик хорошо раскручивается и закручивается, нижний с фианитом не шатается, держится крепко. В комплекте поставки - чёрный бархатный мешочек для хранения пирсинга (на фото сверху). Рекомендуем приобретать какой-либо товар у данного продавца. Качество и доставка на 5 звёздочек!", "2019-02-06T08:05:57.71491601Z", "серебристый", "0", 8, 0, 5, "Пирсинг в пупок", "МАРКИЗ"], "4": ["Пришла с сорванной резьбой,обидно(", "2019-08-10T16:53:17.504143503Z", "серебристый", "0", 0, 1, 1, "Пирсинг в пупок", "МАРКИЗ"], "8": ["Отличный пирсинг. На мой взгляд камушек маловат. Я привыкла к пирсингу покрупней, но все равно взяла. ", "2019-07-28T16:06:16.667335381Z", "серебристый", "0", 1, 0, 5, "Пирсинг в пупок", "МАРКИЗ"], "9": ["Прекрасный пирсинг, миниатюрный, камушек красиво переливается на солнце.Имеется проба, всё пришло хорошо упаковано.", "2019-07-23T16:31:42.168489532Z", "серебристый", "0", 1, 1, 5, "Пирсинг в пупок", "МАРКИЗ"], "10": ["Серьга пришла с браком.Шарик не закручивается.Оформила возврат. Прошу не учитывать в проценте выкупа.", "2019-07-15T11:48:00.828317063Z", "серебристый", "0", 1, 1, 1, "Пирсинг в пупок", "МАРКИЗ"]}
